import React from 'react';
import Nav from './Nav';
import Footer from './Footer';
import Lobby from './Lobby';
import Api from './Api';
import Link from './Link';
import './App.css';

class Nanana extends React.Component {
	render() {
		return (
			<div className={ this.props.className }></div>
		)
	}
}

class Ninini extends Nanana {
	render() {
		super.render()
	}
}

function App() {
  return (
    <div className="App container-fluid ml-lg-4">
      <Api route='/connexion'/>
      <Link to='/connexion'/>
      <Nav/>
      <Lobby/>
      <Footer/>
    </div>
  );
}

export default App;
